import sys
class Solution1:
    """
    @param grid: a 2D grid
    @return: the minimize travel distance
    """
    def minTotalDistance(self, grid):
        if not grid or not grid[0]:
            return None
        homes = set()
        row, col = len(grid), len(grid[0])
        for i in range(row):
            for j in range(col):
                if grid[i][j] == 1:
                    homes.add((i, j))
        min_dist = sys.maxsize
        for i in range(row):
            for j in range(col):
                total_dist = 0
                for p in homes:
                    total_dist += self.dist(p, (i, j))
                if total_dist < min_dist:
                    min_dist = total_dist
        return min_dist

    def dist(self, p1, p2):
        return abs(p2[0] - p1[0]) + abs(p2[1] - p1[1]) 

class Solution:
    """
    @param grid: a 2D grid
    @return: the minimize travel distance
    """
    def minTotalDistance(self, grid):
        if not grid or not grid[0]:
            return None
        row_len, col_len = len(grid), len(grid[0])
        rows = []
        cols = []
        homes = set()
        for i in range(row_len):
            for j in range(col_len):
                if grid[i][j] == 1:
                    rows.append(i)
                    cols.append(j)
                    homes.add((i, j))
        rows.sort()
        cols.sort()
        mid_x = rows[len(rows) // 2]
        mid_y = cols[len(cols) // 2]
        total_dist = 0
        for p in homes:
            total_dist += self.dist(p, (mid_x, mid_y))
        return total_dist
        

    def dist(self, p1, p2):
        return abs(p2[0] - p1[0]) + abs(p2[1] - p1[1]) 

